import React, { Component } from 'react';

class LoggedInUser extends Component {
  state = {};

  render() {
    return (
      <div>
        <p>Welcome {this.props.loggedInUser.username}!</p>
        <button onClick={this.props.logoutUser}>logout</button>
      </div>
    );
  }
}

export default LoggedInUser;
